	if (type == SERVICE_WIN32)  return L"SERVICE_WIN32";
	if (type == SERVICE_DRIVER)  return L"SERVICE_DRIVER";
	if (type == SERVICE_USER_SHARE_PROCESS)  return L"SERVICE_USER_SHARE_PROCESS";
	if (type == SERVICE_USER_OWN_PROCESS)  return L"SERVICE_USER_OWN_PROCESS";
	if (type == SERVICE_KERNEL_DRIVER)  return L"SERVICE_KERNEL_DRIVER";
	if (type == SERVICE_FILE_SYSTEM_DRIVER)  return L"SERVICE_FILE_SYSTEM_DRIVER";
	if (type == SERVICE_ADAPTER)   return L"SERVICE_ADAPTER";
	if (type == SERVICE_RECOGNIZER_DRIVER)  return L"SERVICE_RECOGNIZER_DRIVER";
	if (type == SERVICE_WIN32_OWN_PROCESS) return L"SERVICE_WIN32_OWN_PROCESS";
	if (type == SERVICE_WIN32_SHARE_PROCESS) return L"SERVICE_WIN32_SHARE_PROCESS";
