std::wstring logon_type(ULONG type) {
	log(3, L"🔈logon_type");
	if (type == 0)	return L"UndefinedLogonType";
	if (type == 2)	return L"Interactive";
	if (type == 3)	return L"Network";
	if (type == 4)	return L"Batch";
	if (type == 5)	return L"Service";
	if (type == 6)	return L"Proxy";
	if (type == 7)	return L"Unlock";
	if (type == 8)	return L"NetworkCleartext";
	if (type == 9)	return L"NewCredentials";
	if (type == 10) return L"RemoteInteractive";
	if (type == 11) return L"CachedInteractive";
	if (type == 12) return L"CachedRemoteInteractive";
	if (type == 13) return L"CachedUnloc";
	return L"Unlnown";
}

std::wstring os_architecture(DWORD archi){
	log(3, L"🔈os_architecture");
	if (archi == PROCESSOR_ARCHITECTURE_AMD64) return L"x64(AMD ou Intel)";
	if (archi == PROCESSOR_ARCHITECTURE_ARM) return L"ARM";
	if (archi == PROCESSOR_ARCHITECTURE_ARM64) return L"ARM64";
	if (archi == PROCESSOR_ARCHITECTURE_IA64) return L"Intel Itanium";
	if (archi == PROCESSOR_ARCHITECTURE_INTEL) return L"x86";
	if (archi == PROCESSOR_ARCHITECTURE_UNKNOWN) return L"Architecture inconnue";
	return L"Architecture inconnue";
}

