std::wstring to_FriendlyName(std::wstring guid, unsigned int key) {
	log(3, L"🔈to_FriendlyName");
	PROPERTYKEY p;
	HRESULT hresult = CLSIDFromString(guid.c_str(), &p.fmtid);
	p.pid = key;
	PWSTR out;
	std::wstring result;
	transform(guid.begin(), guid.end(), guid.begin(), ::tolower);
	if (guid == L"{4d545058-4fce-4578-95c8-8698a9bc0f49}") {
		/****************************************************************************
		* This section defines the GUID for MTP Vendor-extended object properties
		****************************************************************************/
		//
		// Microsoft MTP driver combines this GUID and any vendor-extended MTP object property code (as pid) 
		// to construct a WPD PROPERTYKEY, which is reported to WPD applications as a WPD property.
		// For example, vendor extended object prop code, 0xD801, will be reported as WPD PROPERTYKEY:
		// 	{4D545058-4FCE-4578-95C8-8698A9BC0F49}\\D801
		//
		result = L"MTP Vendor-extended object properties";
	}
	else if (guid == L"{4d545058-8900-40b3-8f1d-dc246e1e8370}") {
		/****************************************************************************
		* This section defines the GUID for MTP Vendor-extended device properties
		****************************************************************************/
		//
		// Microsoft MTP driver combines this GUID and any vendor-extended MTP device property code (as pid) 
		// to construct a WPD PROPERTYKEY, which is reported to WPD applications as a WPD property.
		// For example, vendor extended device prop code, 0xD001, will be reported as WPD PROPERTYKEY:
		// 	{4D545058-8900-40b3-8F1D-DC246E1E8370}\\D001
		//
		result = L"MTP Vendor-extended object properties";
	}
	else {
		PSGetNameFromPropertyKey(p, &out);
		if (out == NULL)
			result = L"(Undefined)";
		else
			result = std::wstring(out).data();
	}
	return result;
}

std::wstring networkSubType(unsigned char type) {
	log(3, L"🔈networkSubType");
	if ((type & (unsigned char)0x0F) == (unsigned char)0x01) return L"Domain/WorkGroup Description";
	else if ((type & (unsigned char)0x0F) == (unsigned char)0x02) return L"Server UNC Path";
	else if ((type & (unsigned char)0x0F) == (unsigned char)0x03) return L"Share UNC Path";
	else if ((type & (unsigned char)0x0F) == (unsigned char)0x06) return L"Microsoft Windows Network";
	else if ((type & (unsigned char)0x0F) == (unsigned char)0x07) return L"Entire Network";
	else if ((type & (unsigned char)0x0F) == (unsigned char)0x09) return L"Network Places";
	else if ((type & (unsigned char)0x0F) == (unsigned char)0x0D) return L"Network Places";
	else if ((type & (unsigned char)0x0F) == (unsigned char)0x0E) return L"Network Places";
	else return L"Unknown";
}
